<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>A/B Test: Housing Review Submission</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <!-- Chosen Palette: Warm Neutrals & Muted Teal -->
    <!-- Application Structure Plan: A single-page testing environment presenting two distinct housing review submission forms. A simple "quick form" and a more structured "guided form" will be shown for comparison. Users can interact with both. A final section will prompt for feedback via a QR code. This structure directly facilitates the A/B test by allowing users to experience and compare both prototypes before giving feedback. -->
    <!-- Visualization & Content Choices: Content is presented as two distinct HTML forms. Prototype A uses a simple, single-column layout for perceived speed. Prototype B uses section headers and more specific inputs to test a guided approach. Interaction is limited to form inputs and a JS-powered confirmation message on button click, simulating a submission. No charts or complex visualizations are needed. NO SVG/Mermaid used. -->
    <!-- CONFIRMATION: NO SVG graphics used. NO Mermaid JS used. -->
    <style>
        body {
            font-family: 'Inter', sans-serif;
        }
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap');
        .mock-form {
            border: 1px solid #e2e8f0;
            border-radius: 0.75rem;
            padding: 1.5rem;
            background-color: white;
            box-shadow: 0 4px 6px -1px rgb(0 0 0 / 0.1), 0 2px 4px -2px rgb(0 0 0 / 0.1);
        }
        .mock-input {
            width: 100%;
            border: 1px solid #cbd5e1;
            border-radius: 0.375rem;
            padding: 0.75rem;
            margin-bottom: 1rem;
            background-color: white;
            transition: all 0.2s ease-in-out;
        }
        .mock-input:focus {
            outline: none;
            border-color: #0d9488;
            box-shadow: 0 0 0 2px rgba(20, 184, 166, 0.2);
        }
        .mock-button {
            width: 100%;
            border-radius: 0.375rem;
            padding: 0.75rem;
            color: white;
            font-weight: 600;
            transition: background-color 0.2s;
        }
        .star-rating span {
            font-size: 2.5rem;
            cursor: pointer;
            color: #d1d5db;
        }
    </style>
</head>
